import React, { Component } from 'react';

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="app-top">
          <div className="top-time">
            <p>Call Time: 00:00:00</p>
          </div>
          <input type="number" name="number" id="inputNumber" className="form-control"  readonly="true"/>
        </div>
        <div class="row">
          <div class="col-xs-6 col-sm-4 col-md-12 col-lg-6">
            <button type="button" class="btn btn-number">button</button>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
